import React from "react";
import ReactDOM from "react-dom";
import DropdownMenu from "./dropdownMenu.js";

const App = () => {
    const workManagement = ['Agility', 'Jira', 'Servicenow'];
    const scm = ['Bitbucket', 'Git', 'Teamforge'];

    return (
    <div>
        <h3>Automated Template / workflow Generation</h3>
        <h1>Build you template using ......</h1>
    <DropdownMenu templateOptions={workManagement} labelName={workManagement}/>
    <DropdownMenu templateOptions={scm} labelName={scm}/>  
    </div>
    );
}

// ReactDOM.createRoot(document.querySelector('root'));
ReactDOM.render(<App />, document.querySelector("#root"));
